@thenitinsawhney Furthermore, the 'two sides' approach assumes a neutrality about the caste indulging in that liberality.

There can't be 'neutrality'. Each person or group holds its own assumptions, biases and mores (all mostly unconscious).

True neutrality looks very different.

@grossberg4ky @PiattPatti @RubyBridges @KamalaHarris Ruby Bridges is a descendant of slaves, her parents were sharecroppers. 

Kamala Harris is a descendant of South Asian Brahmins (privileged caste) and wealthy slaveholders. 

This is an insult. “That girl was me”?! No, it wasn’t.

@Lena_Caste_Cam @rosadiezglez @Santi_ABASCAL Sólo una duda.
Cómo hace 20 ó 30 años también se lo hacían a él y a su familia, ¿me podrías explicar por qué era en aquellos años?

Y si entonces también  justificabas lo injustificable, como en este tuit, ¿no serán los otros lo que no cambian?
